//@@DocBrief("The rollover markup descriptor")
class RolloverMarkupDescriptor {
    rolloverBuyMarkup;
    rolloverSellMarkup;
    getRolloverBuyMarkup() {
        return this.rolloverBuyMarkup;
    }
    getRolloverSellMarkup() {
        return this.rolloverSellMarkup;
    }
    static create(rolloverSellMarkup, rolloverBuyMarkup) {
        let result;
        result = new RolloverMarkupDescriptor();
        result.rolloverSellMarkup = rolloverSellMarkup;
        result.rolloverBuyMarkup = rolloverBuyMarkup;
        return result;
    }
}
module.exports = RolloverMarkupDescriptor
